import './App.css';
import { BrowserRouter as Router, Route } from "react-router-dom";

import Navbar from "./components/navbar.component";
import DailyWord from "./components/daily-word.component";
import CreateUser from "./components/create-user.component";
import WordList from "./components/word-list.component";


// Delete this comment later, but routes we will need to start:
/*
  Navbar
  DailyWord (home page)
  CreateUser  ? (from video)
  Word List
*/

function App() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/" exact component={DailyWord} />
        <Route path="/user" component={CreateUser} />
        <Route path="/list" component={WordList} />
      </div>
    </Router>
  );
}

export default App;
